import NavBars from './components/NavBars';


const Index = () => (
    
<div className="wrapper">

<NavBars />

<div>
<img className="Fondo"/>
</div>


<style jsx>{`
        p{   
          font-family: 'Barlow', sans-serif;
          
        }
        div{
            text-align: center;
        }

        img {
          background-image: url(../imgs/body.png);
        }
      `}</style>
</div>

  );
  
  export default Index;
